import React from 'react'
import styled from "@emotion/styled";

const Flag = styled.img`
    width: auto;
    height: 50px;
`

export const parseCountryToJsx = (country) => {
    return (
        <div>
            <div><h3>{country.name}</h3><Flag src={country.flag} style={'width: 50px; height: auto;'} alt={'country_flag'}/></div>
            <strong>Infected: </strong><a>{country.infected}</a><br/>
            <strong>Deaths: </strong><a>{country.deaths}</a><br/>
            <strong>Recovered: </strong><a>{country.recovered}</a><br/>
            <strong>Tests: </strong><a>{country.tests}</a>
        </div>

    )
}
